import {createStore} from 'react-redux';

const initialState = {
    patientDataObj: null,
}

const reducer = (state, action) => {

    switch(action, type) {

        case SETPATIENTDATA:
            patientDataObj: action.payload

        default:
            return state
    }
}

export default createStore(reducer);
